I always knew that you would make an amazing father, which is why it is no surprise that you have stepped into Fatherhood effortlessly. You are so present and you love us in all of the ways we need it. Hendrix may not be able to voice it yet, but I see how much he loves you in the way he looks at you, in his belly laughs, in the way you two play, in his complete admiration for you. You are the best role model for him 🤍 Happy 1st Father’s Day, we love you and adore you so much! 

#fathersday #firstfathersday 
